    true,nt"url": null,nt"notes": "<p>Data from BRFSS for indicators of adult
    oral health for 1999 and even years from 2002 through 2010. National estimates are
    represented by the median prevalence among 50 states and the District of Columbia
    data. Estimates are prepared from the BRFSS public use data sets. Estimates in this
    file are not age adjusted, and may differ slightly from estimates available from
    the BRFSS web site or Chronic Disease Indicators due to small differences in definition,
    age adjustment or rounding. For more information, see: <a href="http://www.cdc.gov/oralhealthdata/overview/Adult_Indicators.html">http://www.cdc.gov/oralhealthdata/overview/Adult_Indicators.html</a></p>n",nt"license_title":
